window.bookSummaryJSON = "<p><i>The Lost Fleet: Relentless</i> found its way onto the New York Times best-seller list...Now <i>Victorious</i> leads the charge again - and \"Black Jack\" Geary is in command....</p> <p>As war continues to rage between the Alliance and Syndicate Worlds, Captain \"Black Jack\" Geary is promoted to admiral - even though the ruling council fears he may stage a military coup. His new rank gives him the authority to negotiate with the Syndics, who have suffered tremendous losses and may finally be willing to end the war. But an even greater alien threat lurks on the far side of the Syndic occupied space.</p> <p><b>Bonus Audio: an exclusive introduction by author Jack Campbell.</b></p>"; 
